import React from 'react';

export default () => {
	return (
		<div id="toolbar">
			<select className="ql-size">
				<option value="small" />
				<option selected />
				<option value="large" />
				<option value="huge" />
			</select>
			<button className="ql-bold" />
			<button className="ql-script" value="sub" />
			<button className="ql-script" value="super" />
		</div>
	);
};
